import React from 'react'
import { useState } from 'react'
const Tasks = [
    {
        id: 1,
        text: 'Doctors Appointment',
        day: 'Feb 5th at 2:30om',
        reminder: true,
    },
    {
        id: 2,
        text: 'School',
        day: 'Feb 6th at 1:30om',
        reminder: true,
    },
    {
        id: 3,
        text: 'Food',
        day: 'Feb 5th at 2:30am',
        reminder: false,
    }
]
function Task() {
    return (
        <>
            {tasks.map((task) => (<h3 key={task.id}>{task.text}</h3>))}
        </>
    )
}

export default Task
